import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
	return (
		<div>
			{robots.map( (user, i) => {
					<Card 
					 id={user[i].id}
					 name={user[i].name} 
					 email={user[i].email}/>				
				})}
		</div>

	);
}

export default CardList;
